import React, { Component } from 'react'

import './Footer.css'

export default class Footer extends Component {
    render() {
        let {doneSum, dutySum} = this.props;
        return (
            <footer>
                <input type="checkbox"/>
                <span>已完成</span>
                <span className="doneSum">{doneSum}</span>
                <span> / 全部</span>
                <span className="dutySum">{dutySum}</span>
                <button>清除已完成任务</button>
            </footer>
        )
    }
}
